func minFlips(s string) int {
	t := s + s
	n := len(s)
	a := strings.Repeat("01", n)
	b := strings.Repeat("10", n)
	da, db := 0, 0
	min := func(a, b int) int {
		if a < b {
			return a
		}
		return b
	}
	ans := n
	for i := 0; i < n*2; i++ {
		if a[i] != t[i] {
			da++
		}
		if b[i] != t[i] {
			db++
		}
		if i >= n {
			if a[i-n] != t[i-n] {
				da--
			}
			if b[i-n] != t[i-n] {
				db--
			}
		}
		if i >= n-1 {
			ans = min(ans, da)
			ans = min(ans, db)
		}
	}
	return ans
}
func minWastedSpace(packages []int, boxes [][]int) int {
	sort.Ints(packages)
	n := len(packages)
	m := len(boxes)
	for i := 0; i < m; i++ {
		sort.Ints(boxes[i])
	}
	min := func(a, b int) int {
		if a < b {
			return a
		}
		return b
	}
	toMod := int(1e9 + 7)
	waste := func(bindex int) int {
		box := boxes[bindex]
		sum := 0
		//
		// for i := 0; i < n; i++ {
		for i := n - 1; i >= 0; i-- {
			l := 0
			r := len(box) - 1
			// lowbound
			for l < r {
				mid := (l + r) >> 1
				if box[mid] >= packages[i] {
					r = mid
				} else {
					l = mid + 1
				}
			}
			// fmt.Println("for packages[i]", i, "-", packages[i], "pick", "box", l, box[l])
			if box[l] < packages[i] {
				return -1
			}
			sum += box[l] - packages[i]
			sum %= toMod
		}
		return sum
	}
	ans := math.MaxInt32
	for i := 0; i < m; i++ {
		w := waste(i)
		fmt.Println("for box i", i, "w", w, "ans", ans)
		if w >= 0 {
			ans = min(ans, w)
		}
	}
	fmt.Println("ansssss", ans)
	if ans == math.MaxInt32 {
		return -1
	}
	return ans
}
func reductionOperations(nums []int) int {
	cnt := make(map[int]int)
	for _, num := range nums {
		cnt[num]++
	}
	keys := make([]int, 0)
	for k := range cnt {
		keys = append(keys, k)
	}
	sort.Ints(keys)
	ans := 0
	for i := len(keys) - 1; i > 0; i-- {
		ans += cnt[keys[i]]
		cnt[keys[i-1]] += cnt[keys[i]]
	}
	return ans
}
